import React from "react";
import web from "../src/images/img2.svg";
import Commom from "./Commom";

const Home = () => {
  return (
    <>
      <Commom
        name="Completely dedicated towards maeking best user experience in websites"
        imgsrc={web}
        visit="/service"
        btname="PortFolio"
      />
    </>
  );
};

export default Home;
